  \"Mercury Concentrations in Biota from J.N. \"Ding\" Darling National Wildlife Refuge:
  A Baseline Study\",\n\t\"tracking_summary\": {\n\t\t\"total\": 3,\n\t\t\"recent\":
  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2016-07-27T22:42:09.582757\",\n\t\"name\": \"mercury-concentrations-in-biota-from-j-n-ding-darling-national-wildlife-refuge-a-baseline-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"In 1990, Lee County, Florida planned to
  construct a combination solid waste incinerator/power generating plant. Solid waste
  incinerators in other areas of the United States have been shown to emit significant
  amounts of mercury and other pollutants into the atmosphere via stack effluents
  (Shaub, 1990). Whereas much of South Florida is heavily contaminated by mercury,
  the southwest section of the state has remained relatively free of this highly toxic
  pollutant (Roelke et al. 1991, Lange et al. 1992). Given the proximity of the proposed
  incinerator to the J.N. \"Ding\" Darling National Wildlife Refuge, a baseline study
  to determine the levels of mercury in raccoons and coon oysters was initiated. Raccoon
  liver concentrations were found to range from 0.075 to 2.87 ppm, wet weight, while
  mercury levels in oysters ranged from 0.016 to 0.041 ppm, wet weight. Both raccoon
  and oyster mercury residues were within the ''normal\" range of concentrations found
  for each organism in Florida. Continued monitoring is recommended in order to assess
  the impact incinerator operation might have on the refuge.\",\n\t\"license_title\":
